import React from 'react';
import Bheem from './components/Bheem';
import Counter from './components/Counter';

function App() {

  const [count, setCount] = React.useState(0);

  function Increment() {
    setCount((oldValue) => {
      return oldValue + 1;
    })
  }

  function Decrement() {
    setCount((oldValue) => {
      return oldValue - 1;
    })
  }

  return (
    <div>
      <Bheem />
      <Counter incre={Increment} decre={Decrement} count={count}/>
    </div>
  );
}

export default App;
